  \"2013-11-26T21:36:19.140252\",\n\t\"name\": \"atlantic-nad-83-continental-shelf-boundary-csb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Continental Shelf
  Boundary (CSB) lines in ESRI shapefile format for the BOEM Atlantic Region. The
  CSB defines the seaward limit of federally managed OCS lands. This CSB file only
  includes the lateral boundaries between the United States and Canada, Bahamas or
  Cuba. That portion of the CSB defined by the 200 nautical mile line is not yet included.
  The BOEM CSB line is similar to, the Exclusive Economic Zone (EEZ) line published
  by NOAA, but the CSB may have slight differences. For example the CSB line will
  include intersection points with the BOEM OCS blocks. Additional details are available
  from OCS Report MMS 99-0006 - Boundary Development on the Outer Continental Shelf:
  http://www.boemre.gov/itd/pubs/1999/99-0006.pdf Because GIS projection and topology
  functions can change or generalize coordinates, these GIS files are considered to
  be approximate and are NOT an OFFICIAL record for the exact baseline coordinates.
  The Official Protraction Diagrams (OPDs) and Supplemental Official Block Diagrams
  (SOBDs) serve as the legal definition for BOEM offshore boundary coordinates and
  area descriptions.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
